            tabContent:"Microsoft's mission is to empower every person and every organization on the planet to achieve more. This includes at Microsoft Ignite where we seek to create a respectful, friendly, and inclusive experience for all participants. As such, we do not tolerate harassing or disrespectful behavior, messages, images, or interactions by any event participant, in any form, at any aspect of the program including business and social activities, regardless of location.We do not tolerate any behavior that is degrading to any gender, race, sexual orientation or disability, or any behavior that would violate Microsoft's Anti-Harassment and Anti-Discrimination Policy, Equal Employment Opportunity Policy, or Standards of Business Conduct. In short, the entire experience at the venue must meet our culture standards.We encourage everyone to assist in creating a welcoming and safe environment. Please report any concerns, harassing behavior, or suspicious or disruptive activity to venue staff, the event host or owner, or the nearest security guard or event staff.Microsoft reserves the right to refuse admittance to or remove any person from Microsoft Ignite at any time in its sole discretion.",
            currentState:"collapse"             
        },
        AccTab6:{
            tabHeading:"What are the accessibility and personal consideration accommodations available at Microsoft Ignite?",
